import React, { Component } from 'react';

class produk extends Component {
    constructor(props) {
        super(props)
        this.state = {
            stok:this.props.stok,
            sub:"Beli",
            status :"Tersedia",
            disable:false
        }
    }
    /* function button */
   btnbeli =()=> {
        this.setState({
            stock:this.state.stok -1
        })
    }
    render() {
        return (
            <div className="box-stock">
                <h2>{this.props.nama}</h2>
                <img src="data:image/jpeg;base64," alt="" />
                <p>Rp. {this.props.harga}</p>
                <p>{this.state.stok}</p>
                <button className="btn-click" onClick={this.btnbeli()} disabled={this.state.disabled}>Beli</button>
                <p>{this.state.status}</p>

            </div>
        );
    }
}

export default produk;
